import Navbar from 'react-bootstrap/Navbar'
import Container from 'react-bootstrap/Container'
import NLogo from './assets/PlogoSmall.png'
import Nav from 'react-bootstrap/Nav'



const NaviBar = () => {
    return ( 
        <>
  <Navbar bg="primary" sticky='top'>
  <Container className='d-flex'>
    <Navbar.Brand href="#home" className=''>
       <img
        src={NLogo}
        
        // width="30"
        // height="30"
        className="d-inline-block align-top"
        alt="Plate Math Logo"
      /> 
     </Navbar.Brand>
     <Nav className="me-auto row flex-fill text-center">
            {/* <div class="vr"></div> */}
            <Nav.Link href="#home" className='fs-5 col border-end  border-dark'><strong>SWR Calculator</strong></Nav.Link>
            {/* <div class="vr"></div> */}
            <Nav.Link href="#features" className='fs-5 col border-end  border-dark'><strong>Explore</strong></Nav.Link>
            {/* <div class="vr"></div> */}
            <Nav.Link href="#pricing" className='fs-5 col'><strong>How To Use</strong></Nav.Link>
      </Nav>
  </Container>
  </Navbar>
</>
     );
}
 
export default NaviBar;
